class Stim {
  
	constructor() {
		this.targets = list_data[window.list]
		this.targets = this.filter('block', [0, window.block])

    this.direction_by = { 
      'по часовой': function(num) { 
        return(num)
      },
      'против часовой': function(num) { 
        return((num-9)*-1)
      }
    }
	}
  get_loop_repetitions(prob_i) {
    const interval = stimules.get_by_key('interval', prob_i);
    const elem_duration = stimules.get_elem_dur(prob_i);
    
    // Целевая общая продолжительность пробы ~1000 мс
    const target_duration = 1000;
    
    // Вычисляем необходимое количество повторений
    // с минимальным значением 4 (как было изначально)
    let repetitions = Math.max(4, Math.round(target_duration / elem_duration));
    
    // Ограничиваем максимальное количество повторений (например, 15)
    repetitions = Math.min(repetitions, 15);
    
    console.log(`Интервал: ${interval}, Длительность элемента: ${elem_duration}, Повторений: ${repetitions}`);
    return repetitions;
  }

  // Функция для получения равенства
  get_example(prob_i) {
    return(this.targets[prob_i].example_first_part + " * " + this.targets[prob_i].example_second_part + " = " + "<span class='example_hide_answr'>" + this.targets[prob_i].answer + "</span>")
  }
  get_example_with_answer(prob_i) {
    return(this.targets[prob_i].example_first_part + " * " + this.targets[prob_i].example_second_part + " = " + this.targets[prob_i].answer)
  }

  // Функция для получения цвета Струп-слова
  get_stroop_color(prob_i) {
    let color = ""
    switch (this.targets[prob_i]['color']) {
      case "голубой": 
        color = "blue"; break;
      case "красный": 
        color = "red"; break;
      case "зелёный": 
        color = "green"; break;
      default:
        color = "white"
    }  
    return(color);
  }
  gt_str_wrd(prob_i, symbol_i) {
    return(this.targets[prob_i]['word'][symbol_i])
  }

  get_direction(counter, item_id) {
    return( this.direction_by[this.targets[counter].fade_direction](item_id)  )
  }
	filter(param, conditions) {
		let result = []
		for (var item in this.targets) {
			if(conditions.includes(this.targets[item][param])) 
				result.push(this.targets[item])
		}
		return(result)
	}
	get_elem_dur(counter) {
		let duration = parseInt(this.targets[counter]['interval'])
		return(duration)
	}
  get_img(counter, files) {
    return(files[condition[ this.targets[counter]['fade_direction'] ] ])
  }
  get_rev_img(counter, files) {
    let img = this.targets[counter]['fade_direction'] == "по часовой"?"против часовой":"по часовой"
    return(files[condition[ img ] ])
  }
  is_rev(counter) {
    return(this.targets[counter]['reverse'] == "1")
  }
	add_elem_cls(counter, elem_i) {
		let hide = elem_i == counter? " hide" : ""
		return('elem el_' + counter + hide)
	}
	get_by_key(key, counter) {
		return(this.targets[counter][key])
	}
	filter_results(keys) { //на вход принимается объект { key1: value1, key2: value2} - нету OR, должны выполняться все условия из списка, только AND
		let new_obj = _.cloneDeep(this)

		console.log(new_obj.targets.length)
		for (var i = new_obj.targets.length - 1; i >= 0; i--) {
			for(var key in keys) {
				if(new_obj.targets[i][key] != keys[key])
					new_obj.targets.splice(i,1);
			}
		}	
		console.log('test select')
		console.log(Object.assign({}, new_obj))
		return(new_obj)
	}
	shuffle(arr) {
		return(arr
						.map(value => ({ value, sort: Math.random() }))
						.sort((a, b) => a.sort - b.sort)
						.map(({ value }) => value))
	}
	shuffle_stim() {
		this.targets = this.shuffle(this.targets)
		return(this)
	}	
}


	
